#include <common.h>

#include "lcp_27.c"

START_TEST(test_official_1) {
    int n = 2, m = 3;
    BlackBox* box = blackBoxCreate(n, m);

    ck_assert_int_eq(blackBoxOpen(box, 6, -1), 6);
    ck_assert_int_eq(blackBoxOpen(box, 4, -1), 4);
    ck_assert_int_eq(blackBoxOpen(box, 0, -1), 6);
    blackBoxClose(box, 6);
    ck_assert_int_eq(blackBoxOpen(box, 0, -1), 4);

    blackBoxFree(box);
}

START_TEST(test_official_2) {
    int n = 3, m = 3;
    BlackBox* box = blackBoxCreate(n, m);

    ck_assert_int_eq(blackBoxOpen(box, 1, -1), 1);
    ck_assert_int_eq(blackBoxOpen(box, 5, 1), 1);
    ck_assert_int_eq(blackBoxOpen(box, 11, -1), 5);
    ck_assert_int_eq(blackBoxOpen(box, 11, 1), 1);
    blackBoxClose(box, 1);
    ck_assert_int_eq(blackBoxOpen(box, 11, 1), 5);
    blackBoxClose(box, 5);
    ck_assert_int_eq(blackBoxOpen(box, 11, -1), 11);

    blackBoxFree(box);
}

